I took a few days off social media because I wasn't feeling the joy and needed to take a step back. I get questions from people occasionally asking how to grow their Instagram. One of the things I say, and any Google search will tell you, is that it's important to post consistently and often. But that sort of routine posting wasn't giving me the spice I needed in my life, so I took a few more days off. I started to vaguely wonder if I was ever going to post again. And then I got a sweet message asking me where I was, and it all came back to me - the joy was never in the posting, it was in the community. It's all the amazing people I've met, the ones I will meet, and the adventures we will have together. Long story short: I'm back, and I missed you! üòã 
